import React, { useState } from 'react'

const Login = () => {
    const [login,setLogin]=useState(false)
  return (
    <div>
      <h3>{login ? "welcome user":"please log in"}</h3>
      <button onClick={()=>setLogin(!login)}></button>
      {login ?"Login":"Logout"}
    </div>
  )
}

export default Login
